import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-white shadow-inner mt-20">
      <div className="max-w-7xl mx-auto px-6 py-8 flex flex-col md:flex-row justify-between items-center text-center md:text-left">
        <div className="text-purple-700 font-bold text-xl mb-4 md:mb-0">
          AI Fashion Fit
        </div>

        <ul className="flex gap-6 text-gray-600 text-sm">
          <li className="hover:text-purple-600 cursor-pointer">Home</li>
          <li className="hover:text-purple-600 cursor-pointer">Features</li>
          <li className="hover:text-purple-600 cursor-pointer">Contact</li>
          <li className="hover:text-purple-600 cursor-pointer">Privacy</li>
        </ul>
      </div>
      <div className="text-gray-400 text-sm text-center pb-6">
        &copy; {new Date().getFullYear()} AI Fashion Fit. All rights reserved.
      </div>
    </footer>
  );
};

export default Footer;
